pragma solidity ^0.8.0;

contract MyContract {
    address[16] public tikets;
    uint public balanceWei = 0;
    address payable public admin  = payable(0xc8D55b1AEe0AF99A99A83Cab4b80fE54032b75c2);


    function transferBalanceToAdmin () public {
        require(msg.sender == admin, "You are not he admin");
        
        admin.transfer(balanceWei);
        balanceWei = 0;
    }

    function buyTiket(uint tiketIndex) payable public returns (bool) {
        // Comprobacin
        require(tiketIndex >= 0 && tiketIndex <= 15, "This ticket does not exist");
        require(msg.value == 0.02 ether, "Insuficient amount of BNB");
        require(tikets[tiketIndex] == address(0), "This ticket is from other person");
        balanceWei += msg.value;


        bool sucess = true;
        tikets[tiketIndex] = msg.sender;

        return sucess;
    }

    function isTicketAvailable (uint tiketIndex) public view returns (bool) {
        // Comprobacin
        require(tikets[tiketIndex] == address(0), "No, this ticket is from other person");

        return true;
        
    }

    function setAdmin (address adminAddress) public {
        // Comprobacin
        require(msg.sender == admin, "You are not he admin");

        admin = payable(adminAddress);
    }
       
    function getTikets() public view returns (address[16] memory) {
        return tikets;
    }

    function getBalance() public view returns (uint256) {
        return payable(address(this)).balance;
    }

    function getBalanceWei() public view returns (uint) {
        return balanceWei;
    }

}
